def getLimits(matrix, left=0, right=0):
	start = np.min(matrix)
	stop = np.max(matrix)
	size = (stop - start)

	start = start + left*size
	stop = stop - right*size
	return (start, stop)

def getBeans(matrix, samples, left=0, right=0):
	start = np.min(matrix)
	stop = np.max(matrix)
	size = (stop - start)

	start = start + left*size
	stop = stop - right*size
	size = (stop - start)
	
	step = size/samples
	return np.arange(start, stop, step)

